import React from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import Header from '../Header';


function Home() {
  document.title="Home Page"
  return (
      <Container fluid >
        <Header />
        <div id="front-image">
        </div>

      <Row className="mx-0">
        <Col md={6}>aasasas</Col>
        <Col md={6}>A</Col>
      </Row>
    </Container>
  );
}

export default Home;
